import { BrowserRouter, Routes, Route } from "react-router-dom";
import Productos from "./components/productos";

function App() {
  return (
    <div className="App">
      <h1>CRUD para agregar un producto</h1>
      <BrowserRouter>
        <Routes>
          <Route path='/' element = {<Productos/>} ex>

          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
